  render () {
      let buttons = [];
      for (let i = 0; i < 4; i++){
          let button = <button key={i.toString()}>{i}</button>;
          buttons.push(button);
      }
    return (
      <div className='parent'>
          <Nav buttons={buttons}>
              <Page>
